DROP TABLE IF EXISTS clustering_titles; CREATE TABLE clustering_titles (id int(11) unsigned NOT NULL AUTO_INCREMENT,id_materia int(11) unsigned NOT NULL,codigo varchar(200) NOT NULL DEFAULT '',metodo varchar(200) NOT NULL DEFAULT '', cluster int(11) unsigned NOT NULL, asignatura varchar(200) NOT NULL DEFAULT '', titulacion varchar(200) NOT NULL DEFAULT '', PRIMARY KEY (id) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
